$_MODULE['<{gmerchantcenterpro}prestashop>basics_e39013ae1c6ff5d43504602bd04bb36a'] = 'Par exemple \"Electronique\" ou \"Vêtements\". Dans la majorité des cas, le fil d\'Arianne (chemin) vers votre produit sera correctement récupéré. Cependant, par sécurité, au cas où la catégorie parente d\'un produit ne serait pas trouvée, le module doit pouvoir entrer une valeur de remplacement. Cette valeur vous permettra ensuite de retrouver facilement les produits concernés, à l\'intérieur de votre compte Google Ads.';
$_MODULE['<{gmerchantcenterpro}prestashop>basics_11179b18128873d6242b490c979e97db'] = 'Quel type de produits vendez-vous ?';
