$_MODULE['<{gmerchantcenterpro}prestashop>basics_83547a842f6ecf60f47c4a13af02de6e'] = 'Si votre boutique utilise plusieurs devises, sélectionnez \"OUI\" et modifiez le fichier robot.txt comme expliqué dans notre FAQ (voir lien ci-contre)';
$_MODULE['<{gmerchantcenterpro}prestashop>basics_73a31090a2346fa50873edba27161a42'] = 'Votre boutique utilise-t-elle plusieurs devises ?';
