$_MODULE['<{gmerchantcenterpro}prestashop>basics_8339930d672bc1689841ad7b63bd9ce0'] = 'Dans la majorité des cas, l\'état de vos produits sera correctement récupéré. Cependant, par sécurité, dans le cas où l\'information ne serait pas trouvée, le module doit pouvoir entrer une valeur de remplacement. L\'état des produits concernés sera alors indiqué par cette valeur dans votre compte Google Ads.';
