$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_56cecbb57ebca052d02a98d4c6d3fd06'] = 'Google Avis Clients';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_45f6fe01875cadbd38fd4bd083dd8f8e'] = 'Google Avis Clients est un service gratuit vous permettant de recueillir l\'avis des clients qui ont effectué un achat sur votre site. Après chaque achat, vos clients sont invités à donner leur accord pour recevoir, après réception de leur commande, un e-mail leur demandant leur avis sur leur expérience d\'achat. Lorsque Google a collecté suffisamment d\'avis, vous pouvez afficher votre note moyenne dans un badge de réassurance \"Google Avis Clients\" sur votre site. N\'hésitez pas à lire';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_dabd9f69d9842e0259a6ccee03bd8b76'] = 'notre FAQ';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_5fe446062455474e0c064e08b20b7f76'] = 'pour plus d\'informations.';
