$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_156014f343ec778d965a9eb91f4eb514'] = 'Un badge Google Avis Clients sera affiché sur la page d\'accueil de votre site avec votre note marchand moyenne (si elle est disponible, voir notre FAQ).';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_d58f5e8aad48f6e722b19eff6481a0b6'] = 'Afficher le badge Google Avis Clients';
