$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_b81b8da6a8437a0cf38dd944e5702983'] = 'Si vous souhaitez que Google recueille également les avis produits, alors vous devez activer l\'envoi des codes GTIN des produits commandés. Attention : les codes envoyés doivent être de vrais codes GTIN, reconnus par Google. Voir notre FAQ pour plus d\'informations.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_548b6f48239a8a40fa5c2cd48219da87'] = 'Envoyer les codes GTIN des produits commandés ?';
