$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_783ab7f7d52b61871c3f7e08b21142ad'] = 'Condition sur le statut de commande';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_4177d75a75534dbb88699d8a389da59e'] = 'Sélectionnez le ou les statut(s) de commande pour le(s)quel(s) vos clients verront s\'afficher la demande de participation à l\'enquête de Google sur la page de confirmation de commande. Nous vous recommandons de sélectionner uniquement les statuts considérés comme valides afin d\'éviter d\'envoyer une demande d\'avis pour une commande annulée pour cause d\'erreur de paiement par exemple.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_99836f130b5bbf07dc34028586749d3a'] = 'Vous devez obligatoirement sélectionner au moins un statut de commande';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_7b31b703238a5573720220057a9cae1d'] = 'Statut(s) de commande valide(s)';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_acd65c3fe0e9de2f64f3bc5c6ad775f0'] = 'Calcul du délai d\'envoi de l\'e-mail';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_8f420de5bed48e09b256bf6d097492cd'] = 'Les champs suivants vont permettre à Google d\'estimer le temps entre le passage de la commande de votre client sur votre boutique et la réception de celle-ci. Cela lui permettra de calculer la date à laquelle envoyer son e-mail de demande d\'avis.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_ac23beef2684c8b62132f2f7692f0baa'] = 'Sélectionnez \"Oui\" si vous expédiez les commandes le jour-même, dans la mesure où elles sont passées avant l\'heure indiquée ci-après.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_07ef222abd650ca817e1b6a9fccaa37d'] = 'Expédition le jour de la commande ?';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_03d482f9d1eac64552dfe926ea4a5bac'] = 'Indiquez l\'heure avant laquelle un client doit passer sa commande pour que celle-ci soit envoyée le jour-même.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_5303f8bb175a1ea738f3cd0cde247d74'] = 'Heure limite pour une expédition le jour-même :';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_8a93aa9e46a6fd0b1f77a5b944845937'] = 'Si vous n\'expédiez pas les commandes le jour-même, indiquez combien de jours prend habituellement l\'envoi d\'une commande, après qu\'elle a été passée sur votre site. Il est déconseillé d\'indiquer une valeur supérieure à 3 jours.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_65bbf9ed4d7dc312137913666d18bd8a'] = 'Nombre moyen de jours avant expédition d\'une commande :';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_5b08ccb4c363a9cef7712ab38434b7ca'] = 'Sélectionnez les jours de la semaine où les commandes NE sont PAS expédiées (par exemple, si votre entreprise est fermée tous les dimanches, cochez \"dimanche\" ci-contre).';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_d1c9cfcd702ede2c344981b0e746dae4'] = 'PAS d\'expédition des commandes les jours de la semaine suivants :';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_3c05e9a48ba55537f06f2d3b82dd49f8'] = 'Indiquez ci-contre les jours supplémentaires de l\'année où les commandes ne sont pas expédiées, comme par exemple les jours fériés ou les jours de congés annuels de votre entreprise. NE cochez PAS les jours de la semaine que vous venez de cocher ci-dessus, ils sont déjà pris en compte à travers le paramétrage précédent.';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_2a2fc6663a110deca315178cb33045eb'] = 'PAS d\'expédition également des commandes les jours de l\'année suivants :';
$_MODULE['<{gmerchantcenterpro}prestashop>google-customer-reviews_aa4c5875806f8684de0aebc46adb4a1d'] = 'Pour chaque transporteur, indiquez la durée de transport habituelle, c\'est à dire le temps moyen (en jours) entre l\'expédition de la commande et son arrivée chez le client.';
