$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_c994f5c074871357742776779a7c6041'] = 'Le tag \"CATÉGORIE DE PRODUITS GOOGLE\" => Vous devez associer chaque catégorie par défaut de produits avec une des catégories officielles de Google';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_199898875215dc70a275c0d08f093180'] = 'Le tag \"TYPE DE PRODUIT\" => Contrairement au tag \"Catégorie de produits Google\", le tag \"Type de Produit\" contient l\'information sur la catégorie du produit selon votre propre classification';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_30945a1160cfef2e6810bad0642a7f39'] = 'Le tag \"LIEN\" => Il s\'agit du lien de l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_6810b70e5cc04b03c7a722703ba1a25c'] = 'Le tag \"LIEN IMAGE\" => Il s\'agit de l\'URL de l\'image principale du produit';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_88e22f6108456494e9ff22cc7d522c77'] = 'Le tag \"CONDITION\" => Il s\'agit de l\'état de l\'article. Il n\'y a que 3 valeurs acceptées : \"neuf\", \"reconditionné\" et \"occasion\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_a6aa6ebcc5dc7d0f145df19c202ed562'] = 'Le tag \"DISPONIBILITÉ\" => il indique la disponibilité de l\'article. Il n\'y a que 3 valeurs acceptées : \"en stock\", \"non disponible\" et \"précommande\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_16bbe64f420f506f1c1fa1af3a02a654'] = 'Le tag \"PRIX\" => Il s\'agit du prix de l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_d89fefbc6021ac272d4cf263c4efb0e6'] = 'Le tag \"GTIN\" => Le \"Global Trade Item Number\" est le code article international. Il fait partie des \"codes produit uniques\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_d1631df5c65d2d968bf89c18253923ef'] = 'Le tag \"MARQUE\" => la marque de l\'article fait partie des \"codes produit uniques\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_faf773fc15ef8b16d055f4d9f4b352ad'] = 'Le tag \"MPN\" => Le \"Manufacturer Part Number\" est la référence fournisseur de l\'article. Il fait partie des \"codes produit uniques\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_5d62534879deeba7dcd2408d27023eae'] = 'Le tag \"RÉSERVÉ AUX ADULTES\" => Ce tag indique que l\'article est réservé aux adultes';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_e05668c1c9f4d44c28508d886219a7ca'] = 'Le tag \"SEXE\" => Ce tag vous permet d\'indiquer le sexe des personnes pour lesquelles le produit est destiné. Vous avez le choix entre 3 valeurs prédéfinies : \"homme\", \"femme\" ou \"unisexe\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_1bfd5e5854d1ac1439d0c1fba2ed8a38'] = 'Le tag \"TRANCHE D\'ÂGE\" => Ce tag vous permet d\'indiquer la tranche d\'âge pour laquelle le produit est destiné. Vous avez le choix entre 5 valeurs prédéfinies : \"adultes\", \"enfants\", \"tout-petits\", \"bébés\" ou \"nourrissons\"';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_230ea3479ccabdfe236c4d65cab2f980'] = 'Le tag \"COULEUR\" => Il indique la(les) couleur(s) dominante(s) de l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_5d553aefd82d6a33ded4e79e6c247ef1'] = 'Le tag \"TAILLE\" => Il indique la taille de l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_7ec9bf76a897c37119f962202e0658fe'] = 'Le tag \"TYPE DE COUPE\" => Ce tag vous permet de donner une information supplémentaire à propos de la taille du vêtement. Vous pouvez choisir entre 6 valeurs prédéfinies : standard, petite taille femme, grande taille femme, grand, grande taille ou maternité';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_e0caa1aed81149343ece066d29a2d4d5'] = 'Le tag \"SYSTÈME DE TAILLES\" => Ce tag vous permet d\'indiquer le sytème de tailles utilisé pour l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_fa5d68cce0c39e329df5d2d417607dea'] = 'Le tag \"MATIÈRE\" =>  Ce tag indique le tissu ou la matière composant principalement l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_cb63bfa0a2d60eb1ab25e1946545367c'] = 'Le tag \"MOTIF\" => Ce tag indique le motif ou l\'imprimé de l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_0aaa55e7c3cb9ea39d8cc4d263d255c6'] = 'Le tag \"CLASSE ÉNERGÉTIQUE\" => Ce tag indique l\'efficacité énergétique de l\'article';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_40bb440b14480f51ab8e7252150fa00e'] = 'Le tag \"ÉTIQUETTE DE LIVRAISON\" => Si vous souhaitez configurer différents frais de port pour des groupes d\'articles spécifiques, utilisez ce tag pour appliquer une étiquette aux articles';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_87542b33ba1d64558d433c0e0bb3e10c'] = 'Le tag \"MESURE DE PRIX UNITAIRE\" => Ce tag représente la quantité ou la dimension totale de l\'article';
