$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_e610fb6e646bf002c065694b3a46e3ec'] = 'Le tag \"ID DE GROUPE D\'ARTICLES\" => Tous les articles qui sont des variantes de couleur/matière/motif/taille d\'un même produit doivent avoir le même ID de groupe d\'articles';
$_MODULE['<{gmerchantcenterpro}prestashop>moduletools_17ee0b6286428a993c39012f45714094'] = 'Le tag \"POIDS DU COLIS\" => Il s\'agit du poids de l\'article utilisé pour calculer les frais de port pour cet article';
